import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <>
      <div>
        <h1>PRAKRUTHI MANJUNATHA</h1>
        <div>
          <Link to={"/"}>Home</Link>
          <Link to={"/about"}>About Me</Link>
          <Link to={"/projects"}>Projects</Link>
          <Link to={"/skills"}>Skills</Link>
        </div>
      </div>
    </>
  );
};

export default Header;
